import React from 'react';
import * as style from '../styles/createStyle';
import { useSelector } from 'react-redux';
import { useParams } from "react-router-dom";
import Link from 'next/link';

import { Image, Space, Tag } from 'antd';

export interface AboutPropTypes {
  pid: any;
}

const AboutLayout = ({ pid }: AboutPropTypes) => {
  const { id } = useParams();
  const posts = useSelector((state:any)=> state.post.mainPosts);
  const post = posts.map((post:any) => post.id === pid);
  console.log(posts)
  console.log(post)

  return(
    <div>
    <style.ImageContainer>
      <Image
          width={200}
          height={200}
          src="error"
          fallback="data:image/png;base64,"
        />
    </style.ImageContainer>
    <style.ServeShow>
      <style.Title>serve</style.Title>
      <div> 1 인분</div>
    </style.ServeShow>
    <style.Title>재료</style.Title>
    <Space size={[0, 'small']} wrap>
      <Tag bordered={false} color="gold">
        processing2
      </Tag>
      <Tag bordered={false} color="gold">
        processing1
      </Tag>
      <Tag bordered={false} color="gold">
        processing3
      </Tag>
    </Space>
    <style.Title>레시피</style.Title>
    <style.recipeWrapper>
      <div className='index'>1</div>
      <div className='content'>레시피1</div>
    </style.recipeWrapper>
    <style.Title>
      참고 링크
    </style.Title>
    <Link href={``}>
      <style.LinkShow>
        링크 보러가기
      </style.LinkShow>
    </Link>
    <style.Btns>
      {id && (
        <>
          <style.Cancle>삭제하기</style.Cancle>
          <style.Submit>
            수정하기
          </style.Submit>
        </>
      )}
    </style.Btns>
  </div>
  )
}

export default AboutLayout;
